import React from 'react';
import './LandingHeader.css'

const LandingHeader = () => {
    return(
      <header className='landingheader'>
        <div className='contents'>
          <h2 className='title'>
              JAYCO
              <h3>
                where coin wokrs
              </h3>
              <hr size="5px"></hr>
          </h2>
        </div>
      </header>
  
    )
  }
  
  export default LandingHeader;
